import React, { Component } from 'react';
import Carousel from 'antd/es/button';
export default class c extends Component {
    render() {
        return (
            <div className="App">
                <Carousel autoplay>
                    <div>
                        <h3>1</h3>
                    </div>
                    <div>
                        <h3>2</h3>
                    </div>
                    <div>
                        <h3>3</h3>
                    </div>
                    <div>
                        <h3>4</h3>
                    </div>
                </Carousel>
            </div>
        );
    }
}
